import React from 'react';

class App extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            bLength: '5'
        }
    }
    render() {
        return (
            <div>
                <div id='title'><h1>Pomodoro Clock</h1>
                
                </div>
                  <div id='lengthDiv'>
                    <div id='breakLength'>
                        <h3>Break Length</h3>
                        <input type='button' id='increment' value='+' />
                        <span>{this.state.bLength}</span>
                        <input type='button' id='decrement' value='-' />
                       
                    </div>
                      <div id='sessionLength'>
                          <h3>Session Length</h3>
                          <input type='button' id='increment' value='+' />
                          <span>{this.state.bLength}</span>
                          <input type='button' id='decrement' value='-' />
                      </div>
                  </div>
                        <div id='clock'></div>
                          <div id='clockBtns'></div>
            </div>
        )
    }
}

export default App;
